import React from 'react'
import { secondSection } from '../global/Data'

function About() {
    return (
        <section className='lg:h-[300px] py-12'>
            <div className='flex flex-col xl:flex-row h-full items-center mt-0'>
                <div className="flex flex-row items-center">
                    {secondSection.map((item,idx)=>{
                        return (
                            <div className='flex flex-row items-center'>
                                <div>
                                    <img src={item.icon} />
                                </div>
                                <div>
                                    <div className="">{item.title}</div>
                                    <div className="">{item.subtitle}</div>
                                </div>
                            </div>
                        )
                    })}
                </div>
            </div>
        </section>
    )
}

export default About
